import React from "react";
import { Link } from "react-router-dom";

import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";

const RegisterForm = () => {
  return (
    <Card className="auth__content-card">
      <h2>Sign up</h2>
      <CardContent>
        <form noValidate autoComplete="off">
          <div>
            <TextField id="standard-basic" label="E-mail" name="email" />
          </div>
          <div>
            <TextField id="standard-basic" label="Login" name="login" />
          </div>
          <div>
            <TextField
              id="standard-basic"
              type="password"
              label="Password"
              name="password"
            />
          </div>

          <div>
            <Button className="submit-btn" variant="contained" color="primary">
              Sign up
            </Button>
          </div>
          <div>
            <Link href="" to="/signin">
              <Button className="change-sign-btn">Sign in</Button>
            </Link>
          </div>
        </form>
      </CardContent>
    </Card>
  );
};

export default RegisterForm;
